import React, { useEffect } from "react";
import { HistoryBox } from "./style";

const MassageHistory = () => {
  const token =
    "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJ1c2VyX2lkIjoiNjNiZTRkMjE4MGRkMjFiMjM4ZTdjMjRmIiwiaWF0IjoxNjczODc0MjU3LCJleHAiOjE2NzY0NjYyNTd9.YHZjuuIiWINgNbk94YNO5nbl0vjc3a6sXIxsGGuBgHA";
  const fetchData = () => {
    fetch(
      "http://172.105.41.247:5004/api/v1/chats/63c57f16a42ac1832a676dc8?page_no=1&page_size=4",
      {
        method: "GET",
        headers: { Authorization: `Bearer ${token}` },
      }
    )
      .then((res) => res.json())
      .then((result) => {
        // setData(result.result.data);
        console.log(result.result.data);
      });
  };
  useEffect(() => {
    fetchData();
  }, []);

  return <HistoryBox>MassageHistory</HistoryBox>;
};
export default MassageHistory;
